import React from 'react'
import { Card } from "react-bootstrap";
import { Link } from "react-router-dom";

function Posts({ post }) {
    return (
        <div>             
            <div className="col-md-12">
                <Card className=" rounded">
                    <Link to={`/post/${post._id}`}>
                        <Card.Img src={post.image} />
                    </Link>
                </Card>                   
            </div>            
        </div>
    )
}

export default Posts
